import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './PatientVerification.module.scss';

const PatientVerification = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    phone: '',
    reason: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // In a real app, you'd validate and process the data here
    navigate('/vitalsresults');
  };

  return (
    <div className="patient-verification-page">
      <div className="header">
        <div className="logo-small">
          <img src="/assets/logo.png" alt="OptiCheck" />
        </div>
        <div className="verification-text">Patient Information</div>
        <div className="info-icon">i</div>
      </div>

      <div className="progress-container">
        <div className="progress-bar">
          <div className="progress-fill" style={{ width: '60%' }}></div>
        </div>
      </div>

      <div className="content-area">
        <div className="form-container">
          <form onSubmit={handleSubmit}>
            <div className="form-field">
              <label htmlFor="name">Name</label>
              <input 
                type="text" 
                id="name" 
                name="name" 
                value={formData.name}
                onChange={handleChange}
                placeholder="Full Name"
                required
              />
            </div>

            <div className="form-field">
              <label htmlFor="email">Email</label>
              <input 
                type="email" 
                id="email" 
                name="email" 
                value={formData.email}
                onChange={handleChange}
                placeholder="Email Address"
                required
              />
            </div>

            <div className="form-field">
              <label htmlFor="phone">Phone</label>
              <input 
                type="tel" 
                id="phone" 
                name="phone" 
                value={formData.phone}
                onChange={handleChange}
                placeholder="Phone Number"
                required
              />
            </div>

            <div className="form-field">
              <label htmlFor="reason">Reason for Visit</label>
              <select 
                id="reason" 
                name="reason" 
                value={formData.reason}
                onChange={handleChange}
                required
              >
                <option value="">Select a reason</option>
                <option value="checkup">Regular Check-up</option>
                <option value="illness">Illness</option>
                <option value="injury">Injury</option>
                <option value="followup">Follow-up Visit</option>
                <option value="other">Other</option>
              </select>
            </div>

            <div className="form-actions">
              <button type="submit" className="submit-button">
                Continue to Vitals
              </button>
            </div>
          </form>

          <div className="info-text">
            This will be Google Sheets info
          </div>
        </div>
      </div>
    </div>
  );
};

export default PatientVerification;
